import React from 'react';
import './pages.css';
import Navbar from '../components/navbar/Navbar';
import image from '../images/header-backgrounds/team.jpg'
import Footer from '../components/footer/Footer';
import Header from '../components/header/Header';
import Position from '../components/player/Position';
import getPlayers from '../components/player/player-data'



export default function Team(){
    let bramkarze
    let rozgrywajacy
    let skrzydlowi
    let obrotowi

    getPlayers().then(data => {
        console.log(data)
        bramkarze = data[0]
        rozgrywajacy = data[1]
        skrzydlowi = data[2]
        obrotowi = data[3]
    })

    return(
        <div className="team-wrapper">
            <Navbar />
            <Header 
                src={image}
                text="Zespół"
                />
            <Position 
                positionName="Bramkarze"
                data={bramkarze}
                />
            <Position 
                positionName="Rozgrywający"
                data={rozgrywajacy}
                />
            <Position 
                positionName="Skrzydłowi"
                data={skrzydlowi}
                />
            <Position 
                positionName="Obrotowi"
                data={obrotowi}
                />
            <Footer />
        </div>
    )
}
